import React, { Component } from 'react';

class SignalHmu extends Component {
  componentDidMount() {
    const Value = "Signal HMU";
    // Implement FetchDevices(Value) and showTotal(Value) functions here
  }

  render() {
    return (
      <div className="App">
        <header>
          {/* Navbar */}
          <nav className="main-header navbar navbar-expand navbar-white navbar-light" id="headbar-dark">
            {/* Left navbar links */}
            <ul className="navbar-nav">
              <li className="nav-item">
                <a className="nav-link" data-widget="pushmenu" href="#" role="button">
                  <i className="fas fa-bars"></i>
                </a>
              </li>
              <li className="nav-item d-none d-sm-inline-block">
                <a href="signal_hmu.html" className="nav-link">Home</a>
              </li>
            </ul>
            {/* Right navbar links */}
            <ul className="navbar-nav ml-auto">
              <li className="nav-item" id="darkmode-btn">
                <div className="nav-link">
                  <i className="fas fa-moon"></i>
                </div>
              </li>
              <li className="nav-item">
                <a className="nav-link" data-widget="fullscreen" href="#" role="button">
                  <i className="fas fa-expand-arrows-alt"></i>
                </a>
              </li>
            </ul>
          </nav>
          {/* Main Sidebar Container */}
          <aside className="main-sidebar elevation-4 sidebar-light-info" id="sidebar-dark">
            {/* Brand Logo */}
            <a href="signal_hmu.html" className="brand-link">
              <img src="dist/img/logo-mini.png" alt="Sensedge Logo" className="brand-image img-circle elevation-3" style={{ opacity: 0.8 }} />
              <img src="dist/img/logo.png" alt="Sensedge Logo" className="brand-text font-weight-light" />
            </a>
            {/* Sidebar User */}
            <div className="sidebar" style={{ overflowY: "auto" }}>
              {/* Include your user panel content here */}
              {/* Sidebar Menu */}
              <nav className="mt-2">
                <ul className="nav nav-pills nav-sidebar flex-column" data-widget="treeview" role="menu" data-accordion="false">
                  <li className="nav-item menu-open">
                    <a className="nav-link active" id="gear-head">
                      <i className="nav-icon fas fa-tachometer-alt"></i>
                      <p>
                        Gear's
                        <i className="right fas fa-angle-left"></i>
                      </p>
                    </a>
                    <ul className="nav nav-treeview" id="gears">
                      <li className="nav-item">
                        <a href="signal_hmu.html" className="nav-link sub-gears active">
                          <i className="nav-icon text-info">1.</i>
                          <p>Signal HMU</p>
                        </a>
                      </li>
                      {/* Repeat the structure for other menu items */}
                    </ul>
                  </li>
                </ul>
              </nav>
            </div>
          </aside>
        </header>

        {/* Main content */}
        <main className="content-wrapper" id="main-dashboard" style={{ minHeight: "517px" }}>
          <section className="content">
            {/* Include your content here */}
          </section>
        </main>

        {/* Main Footer */}
        <footer className="main-footer">
          <strong>Copyright Â© 2023 <a href="https://www.sensedgetss.com/">sensedge</a>.</strong> All rights reserved.
        </footer>
      </div>
    );
  }
}

export default SignalHmu;

















